import React from "react";

export default function Resultado() {
  axios
    .post("http://127.0.0.1:8000/detectar-objeto", this.this.props)
    .then((result) => {
      this.guardarData(result);
    })
    .catch((error) => {
      console.log("la cagamos");
    });
  return <div>Resultado</div>;
}
